import React from "react";
import '../../App.css';
import Footer from "../Footer";
import ServicesCards from "../ServicesCard";


function SignUp() {
    return (
        <>
            <h1 className="signup"> Sign Up </h1>
            <ServicesCards/>
            <Footer />

        </>
    );
}

export default SignUp;
